const pieChartData = {
    labels: ["Product A", "Product B", "Product C", "Product D"],
    datasets: [
      {
        label: "Revenue Breakdown",
        backgroundColor: ["#3498db", "#2ecc71", "#e74c3c", "#9b59b6"],
        data: [30000, 25000, 15000, 20000],
      },
    ],
  };

  export default pieChartData;
